import React from "react";
import "./ProductPage.css";
import CatalogCard from "../../Components/CatalogCard/CatalogCard";
import image from '../../image/main-page-bg.j'

function ProductPage() {
    return (
        <main className="product-catalog">
            <div className="catalog-body">
                <CatalogCard
                    title={"birnima"}
                    link={"../../image/main-page-bg.jpg"}
                    comment={"sfasfaisfadasdas"}
                    country={"yaxshijoy"}
                    prise={"40000"}
                />
                <CatalogCard
                    title={"birnima"}
                    link={"linkyoq"}
                    comment={"sfasfaisfadasdas"}
                    country={"yaxshijoy"}
                    prise={"40000"}
                />
                <CatalogCard
                    title={"birnima"}
                    link={"linkyoq"}
                    comment={"sfasfaisfadasdas"}
                    country={"yaxshijoy"}
                    prise={"40000"}
                />
                <CatalogCard
                    title={"birnima"}
                    link={"linkyoq"}
                    comment={"sfasfaisfadasdas"}
                    country={"yaxshijoy"}
                    prise={"40000"}
                />
                <CatalogCard
                    title={"birnima"}
                    link={"linkyoq"}
                    comment={"sfasfaisfadasdas"}
                    country={"yaxshijoy"}
                    prise={"40000"}
                />
            </div>
        </main>
    );
}

export default ProductPage;
